import './Pagination.css';

const Pagination = (props) => {
    const pages = props.page_count / props.page_size

    let items = [...Array(pages)]
    for (let item_number = 1; item_number <= pages; item_number++) {
        items.push(
            `<span className='pagination__item' 
                   onclick=${ props.componentDidMount(item_number) }>
                ${ item_number }
            </span>`
        )
    }

    return <div className="pagination">
        <span className='pagination__item'>1</span>
        <span className='pagination__item'>2</span>
        <span className='pagination__item'>3</span>
        <span className='pagination__item'>4</span>
        <span className='pagination__item'>5</span>
    </div>
}

export default Pagination;
